import 'package:flutter/material.dart';

void main() {
  runApp(MyApp());
}

class MyApp extends StatelessWidget {
  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      title: 'Category Page',
      theme: ThemeData(
        primarySwatch: Colors.blue,
      ),
      home: CategoryPage(),
    );
  }
}

class CategoryPage extends StatelessWidget {
  // List of categories for the buttons.
  final List<List<String>> categories = [
    ['All', 'Economics'],
    ['Fiction', 'Art', 'History'],
    ['Science', 'Philosophy'],
  ];

  // Dummy list of images. Replace with your actual data source.
  final List<String> imageUrls = [
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS8a6XkPBsURBQKp89Hrt958GmhDxAfmPSiQg&usqp=CAU',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSpi34LV30vPp72hJq2TEz3x7-xkWvH-KYMCQ&usqp=CAU',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSh6zKQpZZlZy4RnkXeMXslIklt9aZQdvLavA&usqp=CAU',
  ];

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text('Category Page'),
      ),
      body: Column(
        children: <Widget>[
          // Category buttons
          for (var row in categories)
            Center(
              child: Row(
                mainAxisAlignment: MainAxisAlignment.center,
                children: row.map((category) => Padding(
                  padding: const EdgeInsets.all(4.0),
                  child: ElevatedButton(
                    onPressed: () {

                    },
                    child: Text(category),
                  ),
                )).toList(),
              ),
            ),
          // Scrollable Image Grid
          Expanded(
            child: GridView.builder(
              padding: const EdgeInsets.all(4.0),
              gridDelegate: SliverGridDelegateWithFixedCrossAxisCount(
                crossAxisCount: 2,
                childAspectRatio: 1 / 1,
                crossAxisSpacing: 10,
                mainAxisSpacing: 10,
              ),
              itemCount: imageUrls.length,
              itemBuilder: (BuildContext context, int index) {
                // In a real app, you would load images from a service or local assets.
                return InkWell(
                  onTap: () {
                    Navigator.push(
                      context,
                      MaterialPageRoute(
                        builder: (context) => ImageDetailScreen(imageUrl: imageUrls[index]),
                      ),
                    );
                  },
                  child: Image.network(imageUrls[index], fit: BoxFit.cover),
                );
              },
            ),
          ),
        ],
      ),
    );
  }
}
class ImageDetailScreen extends StatelessWidget {
  final String imageUrl;

  const ImageDetailScreen({Key? key, required this.imageUrl}) : super(key: key);

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text('Image Detail'),
      ),
      body: Center(
        child: Image.network(imageUrl),
      ),
    );
  }
}
